<!DOCTYPE html>
<html>
<head>
  <style>
  /*theme from http://www.colourlovers.com/palette/3152335/Hello_December by soniapbgomes*/
    body {
      background: #2A2432;
    }
    body * {
      -webkit-user-select: none;
    }
    .foo {
      display: inline-block;
      vertical-align: top;
      height: 50px;
      width: 50px;
    }
    .bar {
      background: #A0AD91;
    }
    .baz {
      background: #BDB89A;
    }
    #test1{
      position: absolute;
      top: 125px;
      left: 125px;
      height: 50px;
      width: 50px;
      background: #FCDBA6;
    }
    #test2{
      position: absolute;
      top: 175px;
      left: 25px;
      height: 50px;
      width: 50px;
      background: #FCDBA6;
    }
    .test{
      display: block;
      position: absolute;
      margin: 0px;
      padding: 0px;
      border: none;
      top: 0px;
      bottom: 0px;
      left: 0px;
      right: 0px;
      background: transparent;
      color: #2A2432;
      text-align:center;
    }
    #clickme {
      position: absolute;
      left:75px;
      top:75px;
      height: 50px;
      width:50px;
      background: #FCDBA6;
      color: #2A2432;
      cursor: pointer;
    }
    #clickme2 {
      position: absolute;
      left:175px;
      top:75px;
      height: 50px;
      width:50px;
      background: #FCDBA6;
      color: #2A2432;
      cursor: pointer;
    }
  </style>
</head>
<body>
<!-- enough divs to take a while to layout -->
<div id="clickme">click here</div>
<div id="clickme2">or here</div>
<script>
  var f = function() {
    var t1 = document.querySelector("#t1");
    var t2 = document.querySelector("#t2");
    var v = 0;
    var doClick = function() {
      t1.value = t2.value = ++v;
    };
    var doClick2 = function() {
      v++;
      t1.value = v;
      var bleh = t1.clientHeight;
      t2.value = v;
    };
    document.querySelector("#clickme").addEventListener('click', doClick, true);
    document.querySelector("#clickme2").addEventListener('click', doClick2, true);
    doClick()
  };
  window.addEventListener('load', f, false);
</script>
<div id='test1'><input id='t1' class='test'/></div>
<div id='test2'><input id='t2' class='test'/></div>
